import { Component } from "react";
import React from "react";
import { Helpers, SimpleGrid, PageMain } from "core";
import NotificationSystem from "react-notification-system";
import Constants from '../../utils/constants';
import { Backward, GetUrl, HandleError } from "../../utils/generals";

export default class RegisterStrLogListPage extends Component
{
    constructor(props)
    {
        super(props);
        this.state = {
            isLoading: true
        };

        this.notificationSystem = React.createRef();

        this.requestId = this.props.match.params.requestId;
    }

    // Events.
    render()
    {
        return this.requestUniqueKey && (
            <>
                <PageMain context={ this } title="فهرست STR" icon="license" isLoading={ this.state.isLoading } footerLinks={[{ href: "/", text: "صفحه اصلی" }]}
                    // topButtons={[
                    //     {
                    //         title: "دانلود STR",
                    //         url: GetUrl("downloadRegisterSTR/" + this.requestId),
                    //         color: "outline-success",
                    //         icon: "list-search",
                    //     },
                    //     {
                    //         title: "فهرست درخواست ثبت STR پولشویی",
                    //         url: GetUrl("registerStrListPage"),
                    //         color: "outline-primary",
                    //         icon: "list-search",
                    //     }
                    // ]}
                    >
                    <div className="card">
                        <div className="card-body">
                            <SimpleGrid context={ this } minHeightTableWrapper={ Constants.MinGridHeight } hasSearchBox hideExportButton
                                filterBgColor="primary" name="grRegisterStrList" title="لاگ درخواست های ثبت STR پولشویی" notificationSystem={ this.notificationSystem } enableAutoFetch
                                listApiUrl="/api/amls/RegisterSTRLog/SearchRegisterSTRLog" extraItemsSentToFetchData={{ Id: this.requestUniqueKey }}
                                headers={[
                                    { title: "ردیف", name: "id" },
                                    { title: "سازمان ارسال کننده گزارش", name: "banckCode" },
                                    { title: "شماره STR", name: "str_Number" },
                                    { title: "تاریخ ارسال گزارش", name: "reportDate" },
                                    { title: "نوع شخصیت", name: "personType" },
                                    { title: "تابعیت", name: "nationalityCode" },
                                    { title: "نوع اقامت", name: "stayType" },
                                    { title: "تاریخ انقضای اقامت", name: "stayExpirationDate" },
                                    { title: "وضعیت حیات", name: "lifeStatus" },
                                    { title: "نام", name: "firstName" },
                                    { title: "نام خانوادگی فرد مورد گزارش", name: "lastName" },
                                    { title: "جنسیت", name: "gender" },
                                    { title: "تاریخ تولد", name: "birthDate" },
                                    { title: "شماره ملی/شناسه ملی", name: "identificationOrNationalCode" },
                                    { title: "شماره شناسنامه/شماره ثبت", name: "birthCertificateNumber" },
                                    { title: "نماینده قانوی اعم از وکیل/ وصی / قیم", name: "legalRepresentative" },
                                    { title: "پرخطربودن منطقه سکونت", name: "highRiskResidentialArea" },
                                    { title: "پر خطر بودن شعبه افتتاح حساب", name: "riskyAccountOpeningBranch" },
                                    { title: "پر خطر بودن شعبه عامل تراکنش", name: "riskyBranchOfTheTransactionAgent" },
                                    { title: "دستگاه پوز ", name: "hasPosDevice" },
                                    { title: "صنف پذیرنده", name: "acceptingClass" },
                                    { title: "حساب متصل به پایانه فروشگاهی", name: "accountConnectedToTheStoreTerminal" },
                                    { title: " قاعده 1", name: "role1" },
                                    { title: " قاعده 2", name: "role2" },
                                    { title: " قاعده 3", name: "role3" },
                                    { title: " قاعده 4", name: "role4" },
                                    { title: " قاعده 5", name: "role5" },
                                    { title: " قاعده 6", name: "role6" },
                                    { title: " قاعده 7", name: "role7" },
                                    { title: " قاعده 8", name: "role8" },
                                    { title: " قاعده 9", name: "role9" },
                                    { title: " قاعده 10", name: "role10" },
                                    { title: " قاعده 11", name: "role11" },
                                    { title: "سطح فعالیت بر حسب میلیون ریال", name: "amountActivityLevel" },
                                    { title: "حساب مشترک دارد", name: "hasAJointAccount" },
                                    { title: "شماره حساب", name: "depositeNumber" },
                                    { title: "نوع حساب", name: "depositeType" },
                                    { title: "نوع ارز", name: "currencyType" },
                                    { title: "مجموع گردش ریال", name: "totalTransactionsAmount" },
                                    { title: "تعداد تراکنش", name: "transactionsCount" },
                                    { title: "از تاریخ", name: "fromDate" },
                                    { title: "تا تاریخ", name: "toDate" },
                                    { title: "مجموع گردش بستانکار حساب یکساله اخیر", name: "totalCreditTurnoverOfTheRecentOneYearAccount" },
                                    { title: "مجموع گردش بدهکار یکساله اخیر", name: "theTotalTurnoverOfDebtorsForTheLastOneYear" },
                                    { title: "وضعیت حساب", name: "depositeStatus" },
                                    { title: "مجموع تراکنش های غیرحضوری یکساله تا زمان ارسال گزارش", name: "totalNumberOfOfflineTransactionsForOneYearUntilTheReportIsSent" },
                                    { title: "تعداد تراکنش های نقدی بالاتر از سقف مقرر در بازه یکساله", name: "numberOfCashTransactionsAboveThePrescribedLimitInAOneYearPeriod" },
                                    { title: "مجموع واریز نقدی به حساب مشتری در بازه زمانی یکساله", name: "totalCashDepositToTheCustomerAccountInAOneYearPeriod" },
                                    { title: "تعداد واریز نقدی به حساب مشتری در بازه یکساله", name: "numberOfCashDepositsToTheCustomerAccountInOneYear" },
                                    { title: "مجموع واریز نقدی به حساب مشتری در بازهزمانی زمانی یکساله", name: "theTotalCashDepositToTheCustomerAccountInAOneYearPeriod" },
                                    { title: "صندوق امانات ", name: "hasSafeBox" },
                                    { title: "نام", name: "firstName1" },
                                    { title: "نام خانوادگی", name: "lastName1" },
                                    { title: "شماره ملی", name: "nationalCode" },
                                    { title: "نوع وابستگی", name: "relationType" },
                                    { title: "توضیحات", name: "describtion" },
                                    { title: "شماره مشتری", name: "customerNumber" },
                                    { title: "کلید", name: "key" }
                                ]} />
                        </div>
                        <div className="card-footer">
                            <div className="d-flex">
                                <a className="btn btn-outline-secendery ms-auto" onClick={ (e) => Backward(e) } href="/" title="بازگشت به صفحه قبل">
                                    بازگشت
                                <i className="ti ti-arrow-left ms-1"></i>
                                </a>
                            </div>
                        </div>
                    </div>
                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>
        );
    }
}
